import './App.css';
import Homepage from "./pages/HomePage";
import SavedPage from "./pages/SavedPage";

import Navbar from "./components/Navbar/Navbar";

function App() {
  return (
    <div className="App">
      <Router>
    <div>
      <Switch>
        <Route exact path="/" component={Homepage} />
        <Route exact path="/saved" component={SavedPage} />
      </Switch>
    </div>
    </Router>


    </div>
  );
}

export default App;
